class OAuth {
  constructor() {
    this.accessToken = '';
  }

  applyToRequest(requestOptions) {
    if (requestOptions && requestOptions.headers) {
      requestOptions.headers["Authorization"] = "Bearer " + this.accessToken;
    }
  }

}

exports.OAuth = OAuth;

class VoidAuth {
  constructor() {
    this.username = '';
    this.password = '';
  }

  applyToRequest(_) {// Do nothing
  }

}

